wp.customize.controlConstructor["kirki-multicheck"]=wp.customize.kirkiDynamicControl.extend({initKirkiControl:function(){var a=this;a.container.on("change","input",function(){var c=[],b=0;jQuery.each(a.params.choices,function(d){if(a.container.find('input[value="'+d+'"]').is(":checked")){a.container.find('input[value="'+d+'"]').parent().addClass("checked");c[b]=d;b++}else{a.container.find('input[value="'+d+'"]').parent().removeClass("checked")}});a.setting.set(c)})}});